import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  title = 'rcc-evento-app2';
}
<!-- Navbar com rotas -->
<nav class="flex justify-between items-center p-4 shadow-md bg-white fixed top-0 w-full z-10">
  <div class="text-xl font-bold text-pink-600">RCC LONDRINA</div>
  <ul class="flex space-x-6 text-gray-700 font-medium">
    <li><a routerLink="/" routerLinkActive="text-pink-600">Home</a></li>
    <li><a routerLink="/inscricoes" routerLinkActive="text-pink-600">Inscrições</a></li>
    <li><a routerLink="/admin" routerLinkActive="text-pink-600">Admin</a></li>
  </ul>
</nav>

<!-- Onde os componentes vão ser renderizados -->
<div class="pt-20">
  <router-outlet></router-outlet>
</div>
